  ,Season        VARCHAR(11) NOT NULL
  ,Crop          VARCHAR(17) NOT NULL
  ,Area          NUMERIC(8,2) NOT NULL
  ,Production    NUMERIC(12,2) NOT NULL
  ,prodarea      NUMERIC(16,9) NOT NULL
  ,max_prodarea  NUMERIC(11,6) NOT NULL
);
